css:
@font-face {
  font-family: 'icomoon';
  font-weight: normal;
  font-style: normal;
  src: url(atom://php-class-tree/resources/fonts/icomoon.woff) format('woff');
}
.php-class-tree-view {
  position: relative;
  width: 200px;
  height: 100%;
  overflow: hidden;
}
.php-class-tree-view > .resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  right: -5px;
  z-index: 10;
  display: block;
  width: 10px;
  cursor: e-resize;
}
.php-class-tree-view > .scroller {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 27px;
  display: block;
  overflow: auto;
}
.php-class-tree-view > .scroller > .list-tree {
  min-height: 100%;
  width: auto;
  min-width: -webkit-min-content;
  padding-left: 5px;
  padding-right: 10px;
}
.php-class-tree-view .name::before {
  font-family: 'icomoon';
  content: attr(data-content-before);
}
.php-class-tree-view .name::after {
  position: absolute;
  right: 10px;
  font-family: 'icomoon';
  content: attr(data-content-after);
}
